import React, { useEffect, useState } from 'react';
import styled, { keyframes } from 'styled-components';
import { FiUpload, FiImage } from 'react-icons/fi';
import { authService } from '../services/authService';

const fadeIn = keyframes`
  from { opacity: 0; transform: translateY(10px); }
  to { opacity: 1; transform: none; }
`;

const Container = styled.div`
  padding: 20px 16px;
  max-width: 1000px;
  margin: 0 auto;
  @media (max-width: 768px) { padding: 16px 12px; }
`;

const Title = styled.h1`
  margin: 0 0 20px 0;
  font-size: 28px;
  font-weight: 700;
  background: linear-gradient(135deg, var(--neon-1), var(--neon-3));
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
`;

const Card = styled.div`
  background: rgba(255, 255, 255, 0.06);
  border: 1px solid rgba(255, 255, 255, 0.12);
  border-radius: 18px;
  padding: 24px;
  box-shadow: 0 6px 20px rgba(0,0,0,0.15);
  margin-bottom: 24px;
  animation: ${fadeIn} 0.3s ease-out;

  @supports (backdrop-filter: blur(10px)) {
    backdrop-filter: blur(12px);
    -webkit-backdrop-filter: blur(12px);
  }
`;

const FileInput = styled.input`
  display: block;
  width: 100%;
  padding: 12px;
  border: 2px dashed rgba(255, 255, 255, 0.2);
  border-radius: 12px;
  background: rgba(255, 255, 255, 0.04);
  color: var(--text-color);
  cursor: pointer;
  transition: all 0.3s ease;
  margin-bottom: 16px;

  &:hover {
    border-color: var(--neon-1);
    background: rgba(255, 255, 255, 0.06);
  }

  &::file-selector-button {
    padding: 8px 16px;
    border: none;
    border-radius: 8px;
    background: linear-gradient(135deg, var(--neon-1), var(--neon-3));
    color: #fff;
    font-weight: 600;
    cursor: pointer;
    margin-right: 12px;
  }
`;

const Button = styled.button`
  padding: 12px 24px;
  border: none;
  border-radius: 12px;
  background: linear-gradient(135deg, var(--neon-1), var(--neon-3));
  color: #fff;
  font-size: 15px;
  font-weight: 600;
  cursor: pointer;
  transition: all 0.3s ease;
  display: inline-flex;
  align-items: center;
  gap: 8px;
  box-shadow: 0 4px 16px rgba(124, 58, 237, 0.3);

  &:hover {
    transform: translateY(-2px);
    box-shadow: 0 6px 20px rgba(124, 58, 237, 0.4);
  }

  &:active {
    transform: translateY(0);
  }
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(160px, 1fr));
  gap: 12px;
  animation: ${fadeIn} 0.4s ease-out;

  @media (max-width: 768px) {
    grid-template-columns: repeat(auto-fill, minmax(120px, 1fr));
  }
`;

const PhotoCard = styled.div`
  aspect-ratio: 1;
  border-radius: 14px;
  overflow: hidden;
  position: relative;
  background: rgba(255, 255, 255, 0.04);
  border: 1px solid rgba(255, 255, 255, 0.08);
  transition: all 0.3s ease;
  cursor: pointer;

  &:hover {
    transform: translateY(-4px);
    box-shadow: 0 8px 24px rgba(0,0,0,0.25);
  }
`;

const Img = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

const EmptyState = styled.div`
  text-align: center;
  padding: 60px 20px;
  color: var(--muted-text);
  animation: ${fadeIn} 0.4s ease-out;
`;

export default function Photos() {
  const [items, setItems] = useState([]);
  const [files, setFiles] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => { load(); }, []);

  const load = async () => {
    try {
      const r = await authService.api.get('/api/photos');
      setItems(r.data);
    } catch (e) {
      console.error(e);
    }
    setLoading(false);
  };

  const upload = async () => {
    if (files.length === 0) return;
    try {
      await authService.photoService.uploadMultipart(files);
      setFiles([]);
      await load();
    } catch (e) {
      alert('Upload échoué: ' + e.message);
    }
  };

  return (
    <Container>
      <Title>Photos</Title>
      <Card>
        <FileInput
          type="file"
          accept="image/*"
          multiple
          onChange={e => setFiles(Array.from(e.target.files))}
        />
        <Button onClick={upload}>
          <FiUpload /> Envoyer ({files.length})
        </Button>
      </Card>

      {loading ? (
        <Grid>
          <div className="skeleton" style={{ aspectRatio: 1, borderRadius: 14 }} />
          <div className="skeleton" style={{ aspectRatio: 1, borderRadius: 14 }} />
          <div className="skeleton" style={{ aspectRatio: 1, borderRadius: 14 }} />
        </Grid>
      ) : items.length === 0 ? (
        <EmptyState>
          <div style={{ fontSize: 48, marginBottom: 12 }}><FiImage /></div>
          <div style={{ fontSize: 18, fontWeight: 600, marginBottom: 8 }}>Aucune photo</div>
          <div>Uploadez vos premières photos ci-dessus</div>
        </EmptyState>
      ) : (
        <Grid>
          {items.map(p => (
            <PhotoCard key={p._id}>
              <Img src={p.url} alt="" />
            </PhotoCard>
          ))}
        </Grid>
      )}
    </Container>
  );
}
